import { LandingPage } from "./components/landing/LandingPage.jsx";
import { Route, Switch } from "react-router-dom";

function App() {
  return (
    <div>
      <Switch>
      <Route exact path="/" component={LandingPage}/>
      </Switch>
    </div>
  );
}

export default App;
